import './App.css';
import NavigationBar from './components/NavigationBar';
import Welcome from './components/Welcome';
import { Col, Container, Row } from 'react-bootstrap';
import Photo from './components/Photo';

function App() {

  const marginTop = {
    marginTop: "2%"
  }

  return (
    <div>
      <NavigationBar />

      <Container>
        <Row>
          <Col lg={12} style={marginTop}>
            <Welcome />
            <Photo />
          </Col>
        </Row>
      </Container>

    </div>
  );
}

export default App;
